Plot:
Unable to handle the taking of his kingdom by an Indian Government decree, the Maharaja kills himself. His son, Jaipal, takes over as the Maharaja, turns rebel, and refuses to hand over his title and kingdom to the Government. It is in this background that Police Superintendent Dhirendra Singh assumes his duties. When a conflict arises between Jaipal and himself, he is transferred to another town. His father, Thakur Ram Avtaar, wants him to marry a childhood friend, Janki, the daughter of Thakur Pratap Singh. When he meets her, he falls in love with her, not knowing that she has given her heart to Manu Pratap Singh, with whose family there is animosity as Pratap's sister had eloped with a male from their family, &amp; was killed at the hands of Pratap. An enraged Pratap, when he finds out about Janki's affair, has her married to Dhirendra. On the day of the marriage, Jaipal's nephew abducts Janki...

This movie has some superhit numbers :
Mere Sung Sung Aaya Teri Yaadon - Kishore Kumar &amp; Chorus	
Bhagi Re Bhagi Brijabala - Mahendra Kapoor, Manhar, Asha	
